lyrics:
{start_of_verse: 1}
Hesaketvmeset likes,
Nak omvlkvn hahicvtet,
Em penkalit, mekusapis,
Cv cukwvn es vkvsamis.
{end_of_verse}

{start_of_verse: 2}
Em vhakv pu mvhayat,
Nak hotcen hahyet pu ’mvtes,
Mvhakv mehenwvt omes,
Cv feken es vkvsamis.
{end_of_verse}

{start_of_verse: 3}
’Mopunvkv herkvt oces,
Em estvlke ’mafvcketvt,
Vm mvttet os, cen kusapit,
Cem vhakvn vrakkuecis.
{end_of_verse}

{start_of_verse: 4}
Vm elkv nettvt ocet os,
Hofunekaranis omes,
Este ’svm mvnettakisem,
Elkv vkueyvte sulkes.
{end_of_verse}

{start_of_verse: 5}
Vn nettv vhoske ’munken,
Cesvs vm ehake ’munken,
Elkv vm oreko ’munken,
Mekusapv hakiyate.
{end_of_verse}

lyrics_en:
{start_of_verse: 1}
God dwells,
He created all things,
I fear Him, so I pray,
I praise Him with my mouth.
{end_of_verse}

{start_of_verse: 2}
His laws that He teaches us,
He made and gives to us in writing,
His laws are very true,
I believe Him with my heart.
{end_of_verse}

{start_of_verse: 3}
There is peace in His words,
His people rejoice in,
I have made mistakes, I beg of you,
I honor your laws.
{end_of_verse}

{start_of_verse: 4}
I have an appointed day to die,
It may not be long,
People younger than me,
Death, has (re)moved many.
{end_of_verse}

{start_of_verse: 5}
While I still have days remaining,
While Jesus still waits for me,
Before death comes to me,
I want to become a Christian.
{end_of_verse}

lyrics:
{start_of_verse: 1}
Aeha! Kut! Cv Hesayecv,
Catv pvlatkvt haks?
Mohmen vm mekko elvt haks?
Cuntv yomusiyan?
{end_of_verse}

{start_of_verse: 2}
Vne holwvyeciyaten,
Eto vtarkvt haks?
Estomahe vnokeckv,
Muntalat sahsekos!
{end_of_verse}

{start_of_verse: 3}
Hvse momvre tetayen,
Yomucket omvtes,
Did darken,
When God (Christ) died,
For man’s sin!
{end_of_verse}

{start_of_verse: 4}
Tohweklepkvn heciyofvt,
Cv turofv ehit,
Vlsusen, cvfeke kafken,
Es hvkihkiyet os.
{end_of_verse}

{start_of_verse: 5}
Cv turopuswv pvlatkis,
Vm vhuere fekeks,
Tokvs! Mucv cem e wikis!
Etvh estohmvkos.
{end_of_verse}

lyrics_en:
{start_of_verse: 1}
Alas! Oh! My Savior,
Did the blood spill?
And did my King die?
For such a worm as I?
{end_of_verse}

{start_of_verse: 2}
For my sins,
Did He hang on the tree?
Love so wonderful,
There is none greater!
{end_of_verse}

{start_of_verse: 3}
The sun, as it was meant to happen,
3
Hesaketvmese elof,
Est’ en holwayeckvn!
{end_of_verse}

{start_of_verse: 4}
When I saw the cross,
I hid my face,
Ashamed, my heart melted,
And I cried.
{end_of_verse}

{start_of_verse: 5}
My drops of tears,
Do not pay my debt,
Now! I give myself to you!
I can do nothing else.
{end_of_verse}

lyrics:
{start_of_verse: 1}
Rvne Kalfvle hocefken,
Es acemecvtes,
Mvn oh elecet omvtes,
Pu Hesayecvhkvn.
{end_of_verse}

{start_of_verse: 2}
Tohweklepkv es cakhehcet,
Tvkopvtayusen,
Enke elleu setetayen,
Svrahrahoyvtes.
{end_of_verse}

{start_of_verse: 3}
Momof punayat makvtes,
Naken kerrekot omakes”,
Kicet vtarkvtes.
{end_of_verse}

{start_of_verse: 4}
Hvse yomocken, ekvnv,
Nekeyen, cvto tis,
Fvlahlen, hvse-vkerkv,
Tutcennat orvtes.
{end_of_verse}

{start_of_verse: 5}
Momof yekcen opunayat,
Vm puyvfekcvn cem wikis”,
Kihcet, elepvtes.
{end_of_verse}

lyrics_en:
{start_of_verse: 1}
On a hill called Calvary,
They climbed,
There they crucified Him,
Our Savior.
{end_of_verse}

{start_of_verse: 2}
They stood up the cross,
His arms were stretched out,
His hand and feet each,
They nailed (to the cross).
{end_of_verse}

{start_of_verse: 3}
Then He said,
For they know not (what they do)”,
He said as He hung (on the cross).
{end_of_verse}

{start_of_verse: 4}
The sun went dark, the earth,
Moved, and the rocks also,
Split, the time,
Was the third hour.
{end_of_verse}

{start_of_verse: 5}
Then He said with a loud voice,
I commend My Spirit”,
He said, then He died.
{end_of_verse}

lyrics:
{start_of_verse: 1}
Puyvfekcv herat vhtet,
Vnen vc vpvkvs,
Cv feke ofvn vn likvs,
Vm ohvtvliyvs.
{end_of_verse}

{start_of_verse: 2}
Ekvnv vc vnokecat,
Holwayeckv haken,
Cv feket vn kawvpkvronks,
Ce cvkayecickvn.
{end_of_verse}

{start_of_verse: 3}
Ehaperkvn ec oh huehkis,
Cv feke kvsvppen,
Vn yvhiketvt vn sumkeps,
Cv tulas’ onvpvn.
{end_of_verse}

{start_of_verse: 4}
Yvn hesakiyet emunket,
Cv ’stemerrusvr haks?
Vm vnokeckvt yekcvronks,
Cenaket yekcetvts.
{end_of_verse}

{start_of_verse: 5}
Puyvfekcv Herat vhtet,
Vnen vc vpvkvs,
Cv feke ofvn vn likvs,
Vm ohvtvliyvs.
{end_of_verse}

lyrics_en:
{start_of_verse: 1}
Come Holy Spirit,
And dwell within me,
Live within my heart,
Increase within me.
{end_of_verse}

{start_of_verse: 2}
Because I love the world,
Sin occurs,
My heart is hardly uplifted,
To follow You.
{end_of_verse}

{start_of_verse: 3}
I call on you in vain,
My heart is cold,
My singing is lost,
On the top of my tongue.
{end_of_verse}

{start_of_verse: 4}
As I continue to live,
Will I suffer more?
My love seems weak,
Yours is stronger.
{end_of_verse}

{start_of_verse: 5}
Come Holy Spirit,
And dwell within me,
Live within my heart,
Increase within me.
{end_of_verse}

lyrics:
{start_of_verse: 1}
Elkv-este toyis,
Cvna wakecares,
Momis, ca’lat vn ’yvfekcv,
Heran? Ayepvr haks?
{end_of_verse}

{start_of_verse: 2}
Liketv,* heraten,
Likiye Munkvr haks?
Elkv en nokke omvlkvn,
Ohfvnkit likar haks?
{end_of_verse}

{start_of_verse: 3}
Ekvnv wikiyof,
Estvmin ayar haks?
Afvcketv yuksv-sekon,
Erorit likar haks?
{end_of_verse}

{start_of_verse: 4}
Pofketvn poheyof,
Pu’honecvkvres,
Nak omvlkvt ep ohfatcof,
Mvn tehecakvres.
* Note: The older song used the word vpette.
{end_of_verse}

lyrics_en:
{start_of_verse: 1}
I am a dying person, (mortal)
I will lay my body down,
Then when I die my spirit,
Will it go to that good place?
{end_of_verse}

{start_of_verse: 2}
In that place of goodness,
Will I dwell there?
All the pains of death,
Will I overcome, and dwell there?
{end_of_verse}

{start_of_verse: 3}
When I leave this world,
Where will I go?
Everlasting happiness,
Will I go, and dwell there?
{end_of_verse}

{start_of_verse: 4}
When we hear the trumpet,
We will all be awaken,
When all has been judged,
We will see each other there.
{end_of_verse}

lyrics:
{start_of_verse: 1}
Este-hopelkv ahuehkan,
Em apohicvkes!
Cen lumhetv tetakvtes,
Ahwet ye hecvkes.
{end_of_verse}

{start_of_verse: 2}
Mekkvlke, yvt en lumhetvts,
En hvlwe mont omis,
Est’ vcakis, hoporrenis,
Pume ont lumhvres.
{end_of_verse}

{start_of_verse: 3}
Hesaketvmese heyvn,
Pu momvranet os,
Pun lumhetvn oh vpeyes,
Pu metetakekot.
{end_of_verse}

{start_of_verse: 4}
Herkvn es pu cvfencicvs,
Momof tvmeceyes,
Mohmen puna elepisem,
Hvlwen kvwapk’ yvres.
{end_of_verse}

lyrics_en:
{start_of_verse: 1}
The grave is calling,
Let’s listen!
Your (grave) is ready,
Come and see.
{end_of_verse}

{start_of_verse: 2}
Here kings will lie, (in graves),
Though they are royalty,
The elect and the wise,
Will lay (in the graves) like us.
{end_of_verse}

{start_of_verse: 3}
The giver and taker of life thus,
Will come unto us,
We go toward our graves,
Though we are not ready.
{end_of_verse}

{start_of_verse: 4}
Heal us with peace,
Then we will fly,
Then when our body dies,
We will rise to heaven.
{end_of_verse}

lyrics:
{start_of_verse: 1}
Tecakkeyvte Emekusapvlke,
Cehofv heyvt ’mopunvkvts, pohvks,
Hvlwe mahen likiye munkvt omis,
Nak omvlkvn hayit, ohfvnkiyet os.
{end_of_verse}

{start_of_verse: 2}
Momis este e feke kvncapuse,
Heciyat vtekat, vpakiyet os,
Momet vm punvkv vnokecusat,
Herkvn ohvtvlaken emiyet os.
{end_of_verse}

{start_of_verse: 3}
Naorkvlke ce pvsvtkeko munket,
Vc oh vkvsamvkatskvren komis,
Cerke take toyis, vne tvlkuset,
Heren ce’fvstvkiye tetayet os.
{end_of_verse}

{start_of_verse: 4}
Yvmv ekvnv estomen fullatskis,
Heren ce’fastvkit ece pakvkis,
Holwvke estomen ropotecatskis,
Cem puyvfekcvn tempueciye munkvts.
{end_of_verse}

{start_of_verse: 5}
Yvmvn ce feke cen kvncapusvken,
Mehenwvn v’mekusapatsken omat,
Ce pvsatkvkof ce vpayvkares,
Hesaketvmeset makvtet omes.
{end_of_verse}

lyrics_en:
{start_of_verse: 1}
Christian brethrens,
Listen to the words of Jehovah,
I still dwell in heaven,
I created everything, I reign over all.
{end_of_verse}

{start_of_verse: 2}
When a persons’ heart is low in spirit,
When I see this, I am with you,
Also I speak with love,
I increase my peace to you.
{end_of_verse}

{start_of_verse: 3}
Sinners before you die,
I want you to believe on me,
I am your Father, I only,
I will take good care of you.
{end_of_verse}

{start_of_verse: 4}
Where ever you maybe on this earth,
I will take good care of you, I will be with you,
Should you go through tribulations,
Your spirit will always be near (me).
{end_of_verse}

{start_of_verse: 5}
When your heart is poor in spirit,
If you truly pray to me,
When you die, I will be with you,
God saith.
{end_of_verse}

lyrics:
Vm vnicvs! Vm vnicvs!
