lyrics:
Hvlwe Cehofvn Likan
{end_of_verse}

{start_of_verse: 1}
Hvlwe Cehofvn likan,
Hesahokat apokes,
Renakv orekaten,
Cesvs vpaket fulles.
{end_of_verse}

{start_of_verse: 2}
Estemerket fullvtes,
Fulleyat omakvtes,
Penkvlkv vtekvket,
Ena nokke ocaket.
{end_of_verse}

{start_of_verse: 3}
E em vsehakisem,
Hvkihhoket fullvtes,
Mvt kerkuecat omvtes,
E feke en nokhokan.
{end_of_verse}

{start_of_verse: 4}
Yv omvl’ hoyanvtes,
Hotosake fullvte,
Estemerrvkekvres,
Hvkihhoke sahsekos.
{end_of_verse}

{start_of_verse: 5}
(Esyvhik’tvn ocaket,
Cesvs likan svpokes,
Pohaks, eslopicakes,
Cesvs en herkvt omes).
Hvlwe Cehofvn Likan Continued
{end_of_verse}

{start_of_verse: 6}
’Yvfekcv vpeyvtes,
Holwakat ropotecet,
Enokketv sekaten,
Afvckaket apokes.
{end_of_verse}

{start_of_verse: 7}
En heren apokepes,
Naket naorihcekos,
Yomucke hecahkekos,
Nvpvt en homehcekos.
{end_of_verse}

{start_of_verse: 8}
Turopuswv sepekon,
Naket feksumhuehcekos,
Nettv yuksv-sekaten,
Yuksv-sekon fekapes.
{end_of_verse}

lyrics_en:
{end_of_verse}

{start_of_verse: 1}
Jehovah lives in heaven,
The saved are there,
Our sight cannot see it,
They are with Jesus.
{end_of_verse}

{start_of_verse: 2}
They lived thru sufferings,
Just like us,
Fear within them,
Their body had sickness.
{end_of_verse}

{start_of_verse: 3}
When they were forbidden,
They went about crying,
Confessing,
Their heart was in pain.
{end_of_verse}

{start_of_verse: 4}
When all is past,
The weary that were here,
Will have no more sorrows,
There will be no crying.
{end_of_verse}

{start_of_verse: 5}
(They will have a song,
They will be where Jesus lives,
Listen, It’s so good,
It’s because of Jesus’ own glory).
{end_of_verse}

{start_of_verse: 6}
The spirit has gone on,
Passing thru the bad,
There is no sickness,
They are happy there.
{end_of_verse}

{start_of_verse: 7}
They are doing well,
No more worries,
No more darkness,
No one will be angry.
{end_of_verse}

{start_of_verse: 8}
There will be no tears,
No more troubled hearts,
The day will never end,
We will have eternal rest.
{end_of_verse}

lyrics:
{start_of_verse: 1}
Ce mekusapeyvte,
Momusen tem vwahes,
Cen herketvn pu ’wahlvs,
Momet ’sepu wahecvs.
{end_of_verse}

{start_of_verse: 2}
Mohmen yvmv ekvnv,
Enkvpvkake yofvt,
Cen liketvn ’roricet,
Fekvpetvn pu ’yaces.
{end_of_verse}

lyrics_en:
{start_of_verse: 1}
We have prayed to You,
At this time we dismiss,
Give us Your peace,
And then dismiss us.
{end_of_verse}

{start_of_verse: 2}
And then this earth,
When we leave it,
And we get to heaven,
We want to rest.
{end_of_verse}

lyrics:
{start_of_verse: 1}
Pu Hayvte toyetskate!
Nere pum fvnnvketsken,
Elkv pu cvkkeko munken,
Nucicen epoh hvyatkes.
{end_of_verse}

{start_of_verse: 2}
Momis este sulke mahet,
Nere yuksv-sekat ’sceyes,
Momen heyv hvthiyvtke,
Enokhokat wakke tayes.
{end_of_verse}

{start_of_verse: 3}
Momis pume pum merretsken,
Pu cvfencvke emunkes,
Momet nvk omvlkvn cemen,
Cem enhonrvkvye munkes.
{end_of_verse}

{start_of_verse: 4}
Pun hesse, epu ’hecicv,
Ceme omat etv sekos,
Monkv pu feke omvlkvn,
Ece ’nokecvken hayvs.
{end_of_verse}

{start_of_verse: 5}
Momen cemen cem vtotket,
Ece ’cvkvpeyeyvres,
Cem vhakvn ’meyaskuset,
Ece ’cvkvpeyeyvres.
{end_of_verse}

{start_of_verse: 6}
Pu Hayvte toyetskate,
Nettv omvlkan pu’pvkvs,
Momen pufeke omvlkvn,
Ece ’nokecvken hayvs.
{end_of_verse}

lyrics_en:
{start_of_verse: 1}
You are our Maker!
You watch us through the night,
Before death comes,
Morning comes while we still sleep.
{end_of_verse}

{start_of_verse: 2}
But, there are many people,
That go into the never-ending night,
And into the morning,
Where the sick are laying.
{end_of_verse}

{start_of_verse: 3}
When you have mercy on us,
Our health is always good,
All things are yours,
Your grace continues.
{end_of_verse}

{start_of_verse: 4}
Our friend watches over us,
There is no other like You,
Therefore with all our heart,
Make them love you.
{end_of_verse}

{start_of_verse: 5}
We will work for you,
We will go with you,
Humbling to your laws,
We will go with you.
{end_of_verse}

{start_of_verse: 6}
You are our Creator,
Be with us everyday,
And with all our heart,
Make them love you.
{end_of_verse}

lyrics:
Chorus:
They went believing,
